runtime: java11
inbound_services:
- warmup
auto_id_policy: default
beta_settings:
  'source_reference': 'https://github.com/Batalaia/App-Individual.git#a485bede3d3b28b238715184a1bf53f5c1765d83'
handlers:
- url: (/.*/)
  static_files: __static__\1welcome.html
  upload: __NOT_USED__
  require_matching_file: True
  login: optional
  secure: optional
- url: (/)
  static_files: __static__\1welcome.html
  upload: __NOT_USED__
  require_matching_file: True
  login: optional
  secure: optional
- url: (/.*\.cur)
